import React, { useState } from "react";
import { skilldata } from "./skilldata";

const ImageSlider = () => {
  const [current, setCurrent] = useState(0);
};

const skill = () => {
  return (
    <>
      {skilldata.map((slide, index) => {
        return <img src={slide.image} alt="skill image" />;
      })}
    </>
  );
};

export default skill;
